import React from "react";
import { Alert, UncontrolledAlert} from "reactstrap";

const ReactStrapAlerts = () =>{
    return(
        <>
          

            <UncontrolledAlert color="warning">
                Uncontrolled Alert [color : warning]
            </UncontrolledAlert>
        </>
    );
}

export default ReactStrapAlerts;
